    false,nt"url": null,nt"notes": "This annual narrative report for the Savanna
    District of the Upper Mississippi River National Wildlife and Fish Refuge summarizes
    Refuge activities during the 2004 fiscal year.  The report begins with an introduction
    to the Refuge and a summary of the yearu2019s highlights and climate conditions.
     Information about monitoring and studies- including surveys and censuses- is provided
    next.  Habitat restoration and management projects are also covered; activities
    include wetland restoration, water level management, moist soil management, mowing,
    farming, timber management, fire management, and vegetation control.  Fish and wildlife
    management is discussed next with emphasis on bird banding, reintroductions, nest
    structures, and invasive animal control.  Coordination activities, such as interagency
    coordination and private land activities, are outlined.  The resource protection
    section provides information about law enforcement, permits, contaminant investigation,
    contaminant cleanup, cultural resource management, and land acquisition support.
     Information about public education and recreation is given including visitor services
    and outreach. Refuge planning and administration are discussed.",nt"license_title":
